  console.log(homePageData)
  return (
    <div>
      <NavBar />
      <div className="home-page-container">
        <Card values={homePageData} toLoad={isLoading} />
      </div>
    </div>
  )
}
HomePage.propTypes = {
  homePageData: PropTypes.array.isRequired,
  isLoading: PropTypes.bool.isRequired
}

export default HomePage
